window.bookSummaryJSON = "<p>Trapped in a dark cult, sixteen-year-old Naomi Aren has lived a quiet, albeit unhappy, life nestled deep in the hills of the Ozarks. With uncut hair, denim skirts, and only roses for friends, Naomi seldom questions why her life is different from other kids at school. Until the day her abusive father, who is also the cult’s leader, announces her wedding. Naomi must marry Dwayne Yerdin, a bully who reeks of sweat and manure and is the only one person who scares her worse than her father. </p> <p>Then she meets Kai, the mysterious boy who brings her exotic new roses and stolen midnight kisses. Kisses that bring her a supernatural strength she never knew she had. As the big day approaches, Naomi unearths more secrets of about her father’s cult. She learns she has power of her own and while Kai may have awakened that power, Naomi must find a way to use it to escape Dwayne and her father - without destroying herself.</p>"; 
